import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';

import {Container} from 'react-bootstrap';
import 'react-bootstrap';

export const Login = () => {  return (
    <div className="App">
    <Container>
      <p>This is login</p>
    </Container>
    </div>
  );
}
